          <h3 style={{ color: "#fff", margin: 0, fontSize: "1.2rem" }}>üíÑ COSMETIC ADMIN</h3>
        </div>
        
        <nav style={navStyle}>
          <Link to="/admin" style={linkStyle}>üìä Dashboard</Link>
          <Link to="/admin/products" style={linkStyle}>üì¶ Qu·∫£n l√Ω S·∫£n ph·∫©m</Link>
          <Link to="/admin/orders" style={linkStyle}>üõí Qu·∫£n l√Ω ƒê∆°n h√†ng</Link>
          <Link to="/admin/users" style={linkStyle}>üë• Kh√°ch h√†ng</Link>
        </nav>

        <button onClick={handleLogout} style={logoutButtonStyle}>üö™ ƒêƒÉng xu·∫•t</button>
      </aside>

      {/* 2. V√ôNG B√äN PH·∫¢I */}
      <div style={mainContentWrapper}>
        
        {/* Header C·ªë ƒë·ªãnh ph√≠a tr√™n */}
        <header style={headerStyle}>
          <div style={{ fontSize: "14px", color: "#666" }}>
            Trang qu·∫£n tr·ªã / <strong>M·ªπ Ph·∫©m</strong>
          </div>
          <div style={{ fontWeight: "bold" }}>Xin ch√†o, Admin üëë</div>
        </header>

        {/* V√ôNG N·ªòI DUNG CU·ªòN ƒê·ªòC L·∫¨P */}
        <main style={scrollableArea}>
          <Routes>
            <Route path="" element={<Dashboard />} />
            <Route path="admin/product" element={<div className="p-4">Trang s·∫£n ph·∫©m (ƒêang ph√°t tri·ªÉn)</div>} />
            <Route path="orders" element={<div className="p-4">Trang ƒë∆°n h√†ng (ƒêang ph√°t tri·ªÉn)</div>} />
            <Route path="users" element={<div className="p-4">Trang kh√°ch h√†ng (ƒêang ph√°t tri·ªÉn)</div>} />
          </Routes>
        </main>

      </div>
    </div>
  );
};

// ================= STYLES =================
const containerStyle = {
  display: "flex",
  height: "100vh",
  width: "100vw",
  overflow: "hidden", // Kh√≥a cu·ªôn to√†n trang
};

const sidebarStyle = {
  width: "260px",
  backgroundColor: "#2c3e50",
  display: "flex",
  flexDirection: "column",
  flexShrink: 0,
};

const navStyle = {
  flex: 1,
  padding: "20px 10px",
  display: "flex",
  flexDirection: "column",
  gap: "8px",
};

const linkStyle = {
  color: "#bdc3c7",
  textDecoration: "none",
  padding: "12px 15px",
  borderRadius: "6px",
  fontSize: "15px",
  transition: "all 0.3s",
  display: "block",
  backgroundColor: "rgba(255,255,255,0.03)",
